import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center", backgroundImage: "./" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
